import React, { Component } from "react";
import { getDatabase, ref, onValue } from "firebase/database";

class appointment extends Component {
  async componentDidMount() {
    const db = getDatabase();
    const starCountRef = ref(db, "annulations/");
    onValue(starCountRef, (snapshot) => {
      const data = snapshot.val();
    });
  }
  render() {
    return (
      // Appointment section start
      <section className="appointment">
        <div className="appointment-wrap">
          <figure>
            <img src={require("../assets/images/resto.jpg")} alt="" />
          </figure>
          <div className="appointment-form">
            <form action="#">
              <div className="form-field half-width">
                <input type="text" placeholder="NAME" required />
                <input type="email" placeholder="Email address" required />
              </div>
              <div className="form-field half-width">
                <div className="select-field">
                  <select>
                    <option>Select service</option>
                    <option>Select service 1</option>
                  </select>
                </div>
                <input type="tel" placeholder="Phone numer" />
              </div>
              <div className="form-field half-width">
                <input type="date" placeholder="date" />
                <input type="time" placeholder="time" />
              </div>
              <div className="form-field">
                <textarea name="notes" placeholder="Your notes"></textarea>
              </div>
              <button className="btn btn-round">Envoyer la proposition</button>
            </form>
          </div>
        </div>
      </section>
      // Appointment section end
    );
  }
}

export default appointment;
